using Microsoft.EntityFrameworkCore;

namespace SeminarskiRSII.WebApi.Database.DataSeed
{
    public static class NovostiSeed
    {
        public static void SeedNovosti(this ModelBuilder modelBuilder)
        {
            string repka = "";
            List<byte> byteList1 = new List<byte>();
            string hexPart1 = repka.Substring(2);
            for (int i = 0; i < hexPart1.Length / 2; i++)
            {
                string hexNumber = hexPart1.Substring(i * 2, 2);
                byteList1.Add((byte)Convert.ToInt32(hexNumber, 16));
            }
            byte[] originalSlika1 = byteList1.ToArray();

            string hotel = "";
            List<byte> byteList2 = new List<byte>();
            string hexPart2 = hotel.Substring(2);
            for (int i = 0; i < hexPart2.Length / 2; i++)
            {
                string hexNumber = hexPart2.Substring(i * 2, 2);
                byteList2.Add((byte)Convert.ToInt32(hexNumber, 16));
            }
            byte[] originalSlika2 = byteList2.ToArray();

            string fullCapacity = "";
            List<byte> byteList3 = new List<byte>();
            string hexPart3 = fullCapacity.Substring(2);
            for (int i = 0; i < hexPart3.Length / 2; i++)
            {
                string hexNumber = hexPart3.Substring(i * 2, 2);
                byteList3.Add((byte)Convert.ToInt32(hexNumber, 16));
            }
            byte[] originalSlika3 = byteList3.ToArray();
            List<Novosti> list = new List<Novosti>();
            list.AddRange(new List<Novosti>()
            {
                new Novosti()
                {
                    Id = 1,
                    Naslov = "Akcije za novu godinu",
                    Sadrzaj = "Docekajte novu godinu u nasem hotelu uz nikad povoljnije cijene",
                    DatumObjave = new DateTime(2024, 12, 20),
                    OsobljeId = 1,
                    Slika = originalSlika2
                },
                new Novosti()
                {
                    Id = 2,
                    Naslov = "Svi smjestajni kapaciteti popunjeni",
                    Sadrzaj = "Prethodni vikend, svi smjestajni kapaciteti bili popunjeni",
                    DatumObjave = new DateTime(2024, 12, 25),
                    OsobljeId = 4,
                    Slika = originalSlika3
                },
                new Novosti()
                {
                    Id = 3,
                    Naslov = "Posjeta hotelu",
                    Sadrzaj = "Nas hotel posjetila reprezentacija Bosne i Hercegovine",
                    DatumObjave = new DateTime(2024, 12, 30),
                    OsobljeId = 4,
                    Slika = originalSlika1
                }
            });
            modelBuilder.Entity<Novosti>().HasData(list);
        }
    }
}
